import "./App.css";
import { React } from "react";
import { Home } from "./Home";
import {BrowserRouter, Routes,Route} from "react-router-dom";
import { GetSearchData } from "./Components/GetSearchData";

function App() {  


  return (
    <BrowserRouter>
    <Routes>
      <Route  element={<Home />} />
      <Route  element={<GetSearchData />} />  
    </Routes>
    </BrowserRouter>

  )
}

export default App;
